import Header from './Header';
import blogo from './pictures/logo1.png';


function App() {
  return (
    <div>
      <Header/>
      <div
        class=" bg-[url('../public/images/banner.jpg')]  bg-center bg-cover w-full h-40">
      </div>
      <div>
        <div>
          <img src={blogo} alt=""/>
        </div>
      </div>


    </div>
  );
}

export default App;
